{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"#fff\",\"borderWidth\":0,\"borderStyle\":\"solid\",\"borderColor\":\"#000\",\"borderRadius\":0},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"subContentId\":\"d741bbcc-ab0c-41b8-ba30-a196ef462df1\",\"metadata\":{\"contentType\":\"Shapes\"}},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":2.0697167755991286,\"y\":4.088360223267504,\"width\":46.84095860566449,\"height\":27.972991001303974,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Relaxation is important, too</strong></p>\\n\\n<p>Like a mountain expedition, a bootcamp is an intense experience that depends on having the right equipment and staying mentally and physically healthy. You will have to work hard... <strong>so relax hard as well!</strong></p>\\n\"},\"subContentId\":\"d1d2beb9-8b44-4b83-afe3-327f1e9f4805\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"<p>The bootcamp covers a lot of topics and can be intense at times which means....</p>\\n\"},{\"x\":57.73420479302832,\"y\":6.455305615685532,\"width\":31.59041394335512,\"height\":43.035370771236884,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>During the Day:</strong></p>\\n\\n<ul>\\n\\t<li>Ideally, you got enough sleep</li>\\n\\t<li>Make sure to stay hydrated</li>\\n\\t<li>Eat well, your brain needs energy</li>\\n\\t<li>Stand up once in a while, maybe stretch a little bit</li>\\n</ul>\\n\"},\"subContentId\":\"512b4b5b-c33f-4a94-9636-fb70081f1cbd\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.178649237472767,\"y\":34.371059573863754,\"width\":46.84095860566449,\"height\":65.62894042613624,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Workspace</strong></p>\\n\\n<p>Ideally, you can set up your workspace before the course starts, including:</p>\\n\\n<ul>\\n\\t<li>Find a place where you're least interrupted, so you can concentrate on the course</li>\\n\\t<li>Set up your desk so that you have everything you need at hand during class</li>\\n\\t<li>Find a chair that you can sit on comfortably; you will spend a lot of time on it</li>\\n\\t<li>Make sure your workspace is well lit.</li>\\n</ul>\\n\"},\"subContentId\":\"bd165591-10e2-46d6-b5ec-d118b8505c56\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":57.734204793028326,\"y\":54.22456717175847,\"width\":21.78649237472767,\"height\":45.187139309798724,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>In General:</strong></p>\\n\\n<ul>\\n\\t<li>Have support system in place</li>\\n\\t<li>Use the weekends to regenerate!</li>\\n\\t<li>Use stress reduction techniques</li>\\n</ul>\\n\"},\"subContentId\":\"b9a39bb7-910b-430b-baa3-b7b5baaaeb25\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":84.81241830065359,\"y\":81.76720446535008,\"widt 0611231371064,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>What are you going to learn</p>\\n\\n<p>(apart from dealing with data)?</p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f47e2133-58cc-44dc-8630-10812afa4140\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":3.2679738562091507,\"y\":12.910611231371064,\"width\":40.30501089324619,\"height\":27.972991001303974,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Climbing a mountain can be exciting but also scary, just like learning new things. Since learning is not a linear process, you will experience ups and downs. How you deal with this rollercoaster of a learning journey, that will make the difference!</p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"6832b0fb-960b-462d-a55e-d641b2c46f4e\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"<p>\\\"Climbing a mountain can be exciting but also scary, just like learning new things\\\"</p>\\n\"},{\"x\":4.357298474945534,\"y\":81.76720446535008,\"width\":30.501089324618736,\"height\":15.062379769932909,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Wait. What? <em>Welcoming errors..?</em></p>\\n\\n<p><strong>Yes!</strong> More on this on the next slide.</p>\\n\"},\"subContentId\":\"29513c51-6822-4794-91ea-ca28e114304f\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goT o/YouTube\",\"copyright\":{\"license\":\"U\"},\"aspectRatio\":\"16:9\"}]},\"subContentId\":\"fa07a57e-a1d8-4d65-b022-51d64d54c53c\",\"metadata\":{\"contentType\":\"Video\",\"license\":\"U\",\"title\":\"On being wrong\",\"authors\":[],\"changes\":[],\"extraTitle\":\"On being wrong\"}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0893246187363834,\"y\":12.910611231371064,\"width\":43.57298474945534,\"height\":32.27652807842766,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>A remark on our mountain analogy: Making mistakes in the mountains can be deadly, so good thing, that we are in a safe learning environment where mistakes do not have dire consequences. But even on a mountain expedition, there will be mistakes happening. So, what we can learn from that is:</p>\\n\\n<p></p>\\n\"},\"subContentId\":\"bd5fefde-50c2-4212-9ae4-23280018136b\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0893246187363834,\"y\":4.303537077123688,\"width\":20.697167755991288,\"height\":6.455305615685532,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>It's okay to be wrong</strong></p>\\n\"},\"subContentId\":\"355ad7c3-77b8-41d8-8fd4-b7219bd8d30e\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":84.81241830065359,\"y\":81.76720446535008,\"width\":13.225925925925926,\"height\":14.060473303007743, \"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"keywords\":[{\"main\":\"Failure is an option\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":3.2679738562091503,\"y\":21.517685385618442,\"width\":65.359477124183,\"height\":73.86784698343568,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"rgb(255, 255, 255)\",\"borderWidth\":0,\"borderStyle\":\"solid\",\"borderColor\":\"#000\",\"borderRadius\":0},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"subContentId\":\"42117a9d-7923-442b-9fd6-8474f3448c83\",\"metadata\":{\"contentType\":\"Shapes\"}},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":7.625272331154684,\"y\":27.972991001303974,\"width\":18.51851851851852,\"height\":19.365916847056596,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>1. Timebox 10/15/20 minutes to try to solve the problem yourself.</p>\\n\"},\"subContentId\":\"1fdf8459-647f-429b-949c-d70692510070\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"<p>1. Timebox 10/15/20 minutes to try to solve the problem yourself.</p>\\n\"},{\"x\":41.394335511982575,\"y\":30.124759539865817,\"width\":22.875816993464053,\"height\":19.365916847056596,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>2. Ask your partner, friend, rubber duck, or random people around you.</p>\\n\"},\"subContentId\":\"5268d4f8-303c-4cbd-a59c-31a8dbf4defc\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"<p>2. Ask your partner / friend / rubber duck / random people around you.</p>\\n\"},{\"x\":4.357298474945534,\"y\":66.70482469541717,\"width\":27.233115468409586,\"height\":23.669453924180285,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>3. After a set amount of time, if you are not making <strong>good</strong> progress, stop and create a 'support ticket' by writing down your problem in a document.</p>\\n\"},\"subContentId\":\"93f91b5d-d948-45d4-a17a-f57b454df7c9\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"<p>3. After X minutes if you are not making GOOD progress stop and Create a support ticket by writing down your problem in a document.</p>\\n\"},{\"x\":41.394335511982575,\"y\":71.00836177254085,\"width\":17.429193899782135,\"height\":15.062379769932909,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>4. Send the support ticket to...</p>\\n\"},\"subContentId\":\"6f8c8a96-b907-4840-8109-7ed2a4eb7b52\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"<p>4.Send this support ticket to...</p>\\n\"},{\"x\":29.411764705882355,\"y\":24.099807631892652,\"width\":40,\"height\":40,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>For example:</p>\\n\\n<ul>\\n\\t<li>Brute force and trial and error methods</li>\\n\\t<li>Look at the course material</li>\\n\\t<li>Google it/ stackoverflow</li>\\n\\t<li>etc.</li>\\n</ul>\\n\\n<p>Really stick to the time frame you set yourself. It is very easy to lose track of time when you're trying to solve a problem on your own. But if you lose too much time while you're stuck, it might not only jeopardize your progress, but also the progression of your teammates.</p>\\n\"},\"subContentId\":\"c4236093-dfb3-4d75-ad49-80e99666023a\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":true,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":30.501089324618736,\"y\":83.91897300391192,\"width\":40,\"height\":40,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Questions to ask yourself when writing the 'support ticket':</p>\\n\\n<ul>\\n\\t<li>What are you trying to achieve?</li>\\n\\t<li>What do you expect to happen?</li>\\n\\t<li>What is the problem you are encountering?</li>\\n\\t<li>What have you tried so far?</li>\\n</ul>\\n\"},\"subContentId\":\"e1be6a56-e0a3-4047-889d-652a99ca6c06\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":true,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"<ul>\\n\\t<li>\\n\\t<p>What are you trying to achieve, what do you expect to happen</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>What is the problem you are encountering</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>What have you tried so far</p>\\n\\t</li>\\n</ul>\\n\"},{\"x\":62.091503267973856,\"y\":83.91897300391192,\"width\":40,\"height\":40,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<ul>\\n\\t<li>Your coa /jpeg\",\"copyright\":{\"license\":\"U\"},\"width\":1920,\"height\":1279}},\"subContentId\":\"0e7c4908-7795-4043-a12a-ad5e6a2b36ba\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.178649237472767,\"y\":12.910611231371064,\"width\":46.84095860566449,\"height\":34.428296616989506,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Mountaineering is a group activity that requires all members to support, trust, and look after each other. This bootcamp is a team effort, too. You will repeatedly work through the material in pairs and groups, and you will also work together on projects. Teamwork is not only an important part of the bootcamp, but very likely in your future career as well.</p>\\n\"},\"subContentId\":\"4d68b1c6-73ac-458d-92b4-72a18b2749e9\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"<p>Mountaineering is a group activity that requires all members to support, trust, and look after each other.</p>\\n\"},{\"x\":53.37690631808279,\"y\":8.607074154247377,\"width\":43.57298474945534,\"height\":86.07074154247377,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Some things to keep in mind:</p>\\n\\n<ul>\\n\\t<li><strong>This is a safe learning environment.</strong>\\n\\n\\t<ul>\\n\\t\\t<li>Be respectful</li>\\n\\t\\t<li>Be patient</li>\\n\\t</ul>\\n\\t</li>\\n\\t<li><strong>We are a team.</strong>\\n\\t<ul>\\n\\t\\t<li>Share ressources</li>\\n\\t\\t<li>Help each other</li>\\n\\t</ul>\\n\\t</li>\\n\\t<li><strong>Build relationships to support each other - even after the bootcamp</strong>\\n\\t<ul>\\n\\t\\t<li>Get to know each other</li>\\n\\t\\t<li>Don't assume</li>\\n\\t</ul>\\n\\t</li>\\n</ul>\\n\"},\"subContentId\":\"5b6f85f9-ecee-487f-9d87-f512398835c7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.178649237472767,\"y\":4.303537077123688,\"width\":20.697167755991288,\"height\":5.164244492548426,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>We're in this together</strong></p>\\n\"},\"subContentId\":\"118938da-824b-4a17-a2d2-3d75136f92e1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":84.81241830065359,\"y\":81.76720446535008,\"width\":13.225925925925926,\"height\":14.060473303007743,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"rgb(190, 179, 179)\",\"borderWidth\":\"2\",\"borderStyle\":\"outset\",\"borderColor\":\"rgb(0, 0, 0)\",\"borderRadius\":\"2\"},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"metadata\":{\"contentType\":\"Shapes\"},\"subContentId\":\"84eb9857-e962-46b5-8d0a-4786587829e1\"},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":86.05664488017429,\"y\":84.13414985776811,\"width\":10.893246187363834,\"height\":8.607074154247377,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Back to the main menu</strong></p>\\n\"},\"m 7-f84d892faed3\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":86.05664488017429,\"y\":83.91897300391192,\"width\":10.893246187363834,\"height\":8.607074154247377,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Back to the main menu</strong></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"2bf09d5d-dd14-4522-a854-42446b2abc42\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":70.80610021786492,\"y\":81.76720446535008,\"width\":13.225925925925926,\"height\":14.060473303007743,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"rgb(190, 179, 179)\",\"borderWidth\":\"2\",\"borderStyle\":\"outset\",\"borderColor\":\"rgb(0, 0, 0)\",\"borderRadius\":\"2\"},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"metadata\":{\"contentType\":\"Shapes\"},\"subContentId\":\"5fc61de0-0b40-4f8a-9229-4fb44d3863ac\"},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":71.67755991285404,\"y\":84.13414985776811,\"width\":11.982570806100219,\"height\":8.607074154247377,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#e74c3c\\\"><strong>Back to the module map</strong></span></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"d0c9d470-1508-425e-837c-5308e8956b46\"},\"alwa
